import "../App.css";
import React from "react";

function ForecastInfo(props) {
  return (
    <div className="ForecastInfo" style={props.logo}>
      <div className="description">{props.weather}</div>
      <div className="temperature">
        {props.temp}
        {props.graph}
      </div>
    </div>
  );
}

export default ForecastInfo;
